/*
---------------------
make the ball bounce off the top and bottom walls
---------------------
*/

const width = 300;
const height = 300;

const e = createEngine(gameCanvas, width, height);

e.add({
  sprite: ball,
  x: 10,
  y: 36,
  vx: 300,
  vy: 100,
  scale: 4,
  update: (me) => {

    // bounce off the left wall
    if (me.x < 0) {
      me.vx = 300;
    }

    // bounce off the right wall
    if (me.x > width - me.width) {
      me.vx = -300;
    }

  },
})

e.start();
